import Notes from './Notes'

const MusicMakerSheet = ({notes, playList1, playList2, playList3}) => {
  return (
    <div className="test flex flex-row border-solid border-2 border-sky-500 w-[80rem] h-[9rem]">

        <Notes notes={notes} playList1={playList1} playList2={playList2} playList3={playList3}/>

    </div>
  )
}

export default MusicMakerSheet
